// Some function can be launch before document ready (and seems intersting)
limesurveySubmitHandler();
needConfirmHandler();
tableCellAdapters();
activateLanguageChanger();
$(document).ready(function() {
    navbuttonsJqueryUi();
    showStartPopups();
    addClassEmpty();
    noScrollOnSelect();
    doToolTipTable();

    if (typeof LEMsetTabIndexes === 'function') {
        LEMsetTabIndexes();
    }
    if (typeof checkconditions != 'undefined')
        checkconditions();
    if (typeof template_onload != 'undefined')
        template_onload();
    if (typeof (focus_element) != 'undefined') {
        $(focus_element).focus();
    }

    // Keypad functions
    var kp = $("input.num-keypad");
    if (kp.length) {
        kp.keypad({
            showAnim: 'fadeIn',
            keypadOnly: false,
            onKeypress: function(key, value, inst) {
                $(this).trigger('keyup');
            }
        });
    }
    kp = $(".text-keypad");
    if (kp.length) {
        var spacer = $.keypad.HALF_SPACE;
        for (var i = 0; i != 8; ++i)
            spacer += $.keypad.SPACE;
        kp.keypad({
            showAnim: 'fadeIn',
            keypadOnly: false,
            layout: [spacer + $.keypad.CLEAR + $.keypad.CLOSE, $.keypad.SPACE, '!@#$%^&*()_=' + $.keypad.HALF_SPACE + $.keypad.BACK, $.keypad.HALF_SPACE + '`~[]{}<>\\|/' + $.keypad.SPACE + $.keypad.SPACE + '789', 'qwertyuiop\'"' + $.keypad.HALF_SPACE + $.keypad.SPACE + '456', $.keypad.HALF_SPACE + 'asdfghjkl;:' + $.keypad.SPACE + $.keypad.SPACE + '123', $.keypad.SPACE + 'zxcvbnm,.?' + $.keypad.SPACE + $.keypad.SPACE + $.keypad.HALF_SPACE + '-0+', $.keypad.SHIFT + $.keypad.SPACE_BAR + $.keypad.ENTER],
            onKeypress: function(key, value, inst) {
                $(this).trigger('keyup');
            }
        });
    }

    // Maxlength for textareas TODO limit to not CSS3 compatible browser
    maxlengthtextarea();

});

/**
 * setJsVar : Get all global used var
 */
function setJsVar() {
    bFixNumAuto = LSvar.bFixNumAuto;
    bNumRealValue = LSvar.bNumRealValue;
    LEMradix = LSvar.sLEMradix;
    numRegex = new RegExp('[^-' + LEMradix + '0-9]','g');
    intRegex = new RegExp('[^-0-9]','g');
}
// Deactivate all other button on submit
function limesurveySubmitHandler() {
    // Return false disallow all other system
    $(document).on("click", ".disabled", function() {
        return false
    });
    //$(document).on("click",'.active',function(){return false;});// "[active]" don't seem to work with jquery-1.10.2

    $(document).on('click', "#limesurvey .button", function(event) {
        $(this).prop('active', true).addClass('active');
        $("#limesurvey .button.ui-button").not($(this)).button("option", "disabled", true);
        $("#limesurvey .button").not($(this)).prop('disabled', true).addClass('disabled');
    });
    if (document.all && !document.querySelector) {
        // IE7 or lower
        $(function() {
            $("#defaultbtn").css('display', 'inline').css('width', '0').css('height', '0').css('padding', '0').css('margin', '0').css('overflow', 'hidden');
            $("#limesurvey [type='submit']").not("#defaultbtn").first().before($("#defaultbtn"));
        });
    }
}

// Ask confirmation on click on .needconfirm
function needConfirmHandler() {
    $(document).on('click', "[data-confirmedby]", function(event) {
        text = $("label[for='" + $(this).data('confirmedby') + "']").text();
        if (confirm(text)) {
            $("#" + $(this).data('confirmedby')).prop('checked', true);
            return true;
        }
        $(".button.ui-button").button("option", "disabled", false);
        $(".button").prop('disabled', false).removeClass('disabled');
        $(this).prop('active', false).removeClass('active');
        return false;
    });
}
/**
 * checkconditions : javascript function attach to some element 
 * Launch ExprMgr_process_relevance_and_tailoring with good value
 */
function checkconditions(value, name, type, evt_type) {
    if (typeof evt_type === 'undefined') {
        evt_type = 'onchange';
    }
    if (type == 'radio' || type == 'select-one') {
        $('#java' + name).val(value).trigger("input");
        //angular.element($('#java'+name)).triggerHandler('input');

    } else if (type == 'checkbox') {
        if ($('#answer' + name).is(':checked')) {
            $('#java' + name).val('Y').trigger('input');
            //angular.element($('#java'+name)).triggerHandler('input');
        } else {
            $('#java' + name).val('').trigger('input');
            //angular.element($('#java'+name)).triggerHandler('input');
        }
    } else if (type == 'text' && name.match(/other$/)) {
        $('#java' + name).val(value).trigger('input');
        //angular.element($('#java'+name)).triggerHandler('input');
    }
    if ($.isFunction(window.ExprMgr_process_relevance_and_tailoring))
        ExprMgr_process_relevance_and_tailoring(evt_type, name, type);

    // ketika pilih jawaban
    if (name != undefined && name != '') {
        var kodeSoal = name.substr(0, 1);
        var nomorSoal = name.substr(1);

        var index = soal.findIndex(p => p.kode == kodeSoal && p.nomor == nomorSoal);
        soal[index]['jawaban'] = value;

        let dijawab = 0;
        let totalSoal = 0;

        totalSoal = soal.length;
        if (totalSoal > 0) {
            dijawab = soal.filter(x => (x.jawaban != null)).length;
        }

        $('#progresSurvey').html('<span>' + dijawab + ' dari ' + totalSoal + ' Soal</span>');
    }

    var curr = String(name);
    var next = '#question' + curr.substr(0, 1) + (parseInt(curr.substr(1, curr.length - 1)) + 1);

    if (!$(next).length) {
        var next = '#question' + curr.substr(0, 1) + (parseInt(curr.substr(1, curr.length - 1)) + 2);
    }

    //if($(next).length){
    //    $('html, body').animate({
    //        scrollTop: $(next).offset().top - (window.screen.availHeight / 4)
    //    }, 1000); 
    //}else{
    //    var next = '#question'+String.fromCharCode(curr.substr(0,1).charCodeAt(0) + 1)+'1';
    //    if($(next).length){
    //        $('html, body').animate({
    //            scrollTop: $(next).offset().top - (window.screen.availHeight / 4)
    //        }, 1000); 
    //    }  
    //}
}

/**
 * fixnum_checkconditions : javascript function attach to some element 
 * Update the answer of the user to be numeric and launch checkconditions
 */
function fixnum_checkconditions(value, name, type, evt_type, intonly) {
    newval = new String(value);

    /**
     * If have to use parsed value.
     */
    if (!bNumRealValue) {
        if (typeof intonly !== 'undefined' && intonly == 1) {
            newval = newval.replace(intRegex, '');
        } else {
            newval = newval.replace(numRegex, '');
        }
        aNewval = newval.split(LEMradix);
        if (aNewval.length > 0) {
            newval = aNewval[0];
        }
        if (aNewval.length > 1) {
            newval = newval + "." + aNewval[1];
        }
        if (newval != '-' && newval != '.' && newval != '-.' && newval != parseFloat(newval)) {
            // Todo : do it in reg
            newval = '';
        }
    }

    /**
     * If have to fix numbers automatically.
     */
    if (bFixNumAuto) {

        /**
         * Work on length of the number
         * Avoid numbers longer than 20 characters before the decimal separator and 10 after the decimal separator. 
         */
        var midval = newval;
        var aNewval = midval.split('.');
        var newval = '';

        // Treat integer part            
        if (aNewval.length > 0) {
            var intpart = aNewval[0];
            newval = (intpart.length > 20) ? '99999999999999999999' : intpart;
        }

        // Treat decimal part, if there is one.             
        // Trim after 10th decimal if larger than 10 decimals.
        if (aNewval.length > 1) {
            var decpart = aNewval[1];
            if (decpart.length > 10) {
                decpart = decpart.substr(0, 10);
            } else {
                decpart = aNewval[1];
            }
            newval = newval + "." + decpart;
        }

        /**
         * Set display value
         */
        displayVal = newval;
        if (LEMradix === ',') {
            displayVal = displayVal.split('.').join(',');
        }
        if (name.match(/other$/)) {
            $('#answer' + name + 'text').val(displayVal);
        }
        $('#answer' + name).val(displayVal);
    }

    /**
     * Check conditions
     */
    if (typeof evt_type === 'undefined') {
        evt_type = 'onchange';
    }
    checkconditions(newval, name, type, evt_type);
}

