// round function from phpjs.org
function round(value, precision, mode) {
    // http://kevin.vanzonneveld.net
    var m, f, isHalf, sgn;
    // helper variables
    precision |= 0;
    // making sure precision is integer
    m = Math.pow(10, precision);
    value *= m;
    sgn = (value > 0) | -(value < 0);
    // sign of the number
    isHalf = value % 1 === 0.5 * sgn;
    f = Math.floor(value);

    if (isHalf) {
        switch (mode) {
        case 'PHP_ROUND_HALF_DOWN':
            value = f + (sgn < 0);
            // rounds .5 toward zero
            break;
        case 'PHP_ROUND_HALF_EVEN':
            value = f + (f % 2 * sgn);
            // rouds .5 towards the next even integer
            break;
        case 'PHP_ROUND_HALF_ODD':
            value = f + !(f % 2);
            // rounds .5 towards the next odd integer
            break;
        default:
            value = f + (sgn > 0);
            // rounds .5 away from zero
        }
    }

    return (isHalf ? value : Math.round(value)) / m;
}

/* Maxlengt on textarea */
function maxlengthtextarea() {
    // Calling this function at document.ready : use maxlength attribute on textarea
    // Can be replaced by inline javascript
    $("textarea[maxlength]").change(function() {
        // global solution
        var maxlen = $(this).attr("maxlength");
        if ($(this).val().length > maxlen) {
            $(this).val($(this).val().substring(0, maxlen));
        }
    });
    $("textarea[maxlength]").keyup(function() {
        // For copy/paste (not for all browser)
        var maxlen = $(this).attr("maxlength");
        if ($(this).val().length > maxlen) {
            $(this).val($(this).val().substring(0, maxlen));
        }
    });
    $("textarea[maxlength]").keydown(function(event) {
        // No new key after maxlength
        var maxlen = $(this).attr("maxlength");
        var k = event.keyCode;
        if (($(this).val().length >= maxlen) && !(k == null || k == 0 || k == 8 || k == 9 || k == 13 || k == 27 || k == 37 || k == 38 || k == 39 || k == 40 || k == 46)) {
            // Don't accept new key except NULL,Backspace,Tab,Enter,Esc,arrows,Delete
            return false;
        }
    });
}
